import React, { useEffect, useState } from 'react';
import Head from "next/head";
import Link from "next/link";
import Header from "../../../compornents/Header/header";
import Sidebar from "../../../compornents/totalSidebar"
import Json from "../../../Json/adventruer/job.json";

const Index = (props) => {
    const [num, setNum] = useState(0);

    useEffect(() => {
        console.log(num)
        document.querySelector("#__next").style.backgroundImage = `url(../../images/ranking/background.png)`;
    
        let rankingInsignia = document.querySelector(".ranking__insignia");
        let width = -260;   
        
        rankingInsignia.style.transition = ".5s";
        let translateX = num * width >= width * 2 ? 0 : (num - 2) * width < -1560 ? -1560 : (num - 2) * width;

        rankingInsignia.style.transform = `translateX(${translateX}px)`;

        let worldImg = document.querySelectorAll(".ranking__insignia > div"); 

        worldImg.forEach(img => {
            console.log(worldImg)
            img.backgroundImage = `url(../../images/ranking/insignia.png)`;
        })
    })

    const world = [
        "luna",
        "scania",
        "elysium",
        "croa",
        "aurora",
        "bera",
        "red",
        "union",
        "zenith",
        "enosis",
        "arcane",
        "nova"
    ]

    return (
        <div>
            <Head>
                <title>msg.gg</title>
                <link rel="stylesheet" href="/style/header.css" />
                <link rel="stylesheet" href="/style/ranking.css"/>
                <link
                    href="https://fonts.googleapis.com/css2?family=Noto+Sans+KR:wght@300;400;700&display=swap"
                    rel="stylesheet"
                ></link>
            </Head>
            <Header></Header>
            <div className="wrap">
                <Sidebar kind="World"/>
                <div className="ranking__main">
                    <img id="prev-btn" className="pointer" src="../../images/left-button.png" onClick={()=>setNum(num - 1 < 0 ? 0 : num - 1)} alt=""/>
                    <div>
                        <div className="ranking__insignia">
                            <div className="flex-center pointer"><img src="../../images/ranking/world/luna.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/scania.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/elysium.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/croa.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/aurora.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/bera.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/red.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/union.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/zenith.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/enosis.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/arcane.png" alt=""/></div>
                            <div className="flex-center pointer"><img src="../../images/ranking/world/nova.png" alt=""/></div>
                        </div>
                    </div>
                    <img id="next-btn" className="pointer" src="../../images/right-button.png" onClick={()=>setNum(num + 1 > world.length ? world.length : num + 1)} alt=""/>
                </div>
            </div>
        </div>
    );
};

export default Index;
